import React from 'react'

export default function LoginControl({ changeVisibleSignInComponent }) {
  return (
    <div className="login-btn-control">
      <span className="btn btn-light my-4"
        onClick={changeVisibleSignInComponent}>
        SignIn / SignUp</span>
    </div>
  )
}
